import './App.css';

function LostPerson() {
  return (
    <div className="LostPerson">
      <form>
        <h3> Persona Extraviada</h3>
        <label>
          Perona Extraviada
          <input type="text" name="name" />
        </label>
        <input type="submit" value="Submit" />
      </form>
    </div>
  );
}

export default LostPerson;
